package com.miglazer.stocklending.repository;import com.miglazer.stocklending.data.Equity;import org.springframework.stereotype.Repository;import java.math.BigDecimal;import java.util.Arrays;import java.util.List;@Repositorypublic class StockLendingRepository {    public List<Equity> equities() {        return Arrays.asList(                new Equity("IBM", new BigDecimal("107.45")),                new Equity("MSFT", new BigDecimal("35.36")));    }}